import React from 'react'
import './Menu.scss'

class Menu extends React.Component {
    render() {
        return (
            <div className='Menu'>
                <ul>
                    <li>Today</li>
                    <li>Next 7 days</li>
                    <li>Important</li>
                </ul>
            </div>
        )
    }
}

export default Menu
